// src/screens/Home.js

import React from 'react'
import { StyleSheet, View, Text } from 'react-native'

function DetailActors(props) {
  const { route } = props
  const { item } = route.params
  console.log(item);
  return (
    <View style={styles.container}>
      <Text style={styles.text}>{item['First Name'] + ' ' + item['Last Name']}</Text>
      <View style={styles.card}>
        <Text style={styles.cardText}>Movies As Actor Actress:</Text>
        <Text style={styles.cardText}>Movies As Director: {item['Movies As Director']}</Text>
		<Text style={styles.cardText}>Movies As Producer: {item['Movies As Producer']}</Text>
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#ebebeb'
  },
  text: {
    color: '#101010',
    fontSize: 24,
    fontWeight: 'bold'
  },
  card: {
    width: 350,
    height: 400,
    borderRadius: 10,
    backgroundColor: '#101010',
    margin: 10,
    padding: 10,
    alignItems: 'left'
  },
  cardText: {
    fontSize: 18,
    color: '#ffd700',
    marginBottom: 5
  }
})

export default DetailActors
